import * as React from 'react';
import { Text,TextInput,View, Image,ImageBackground, StyleSheet } from 'react-native';
import { Icon,Button,Card } from 'react-native-elements'
import { Avatar, Accessory } from 'react-native-elements';
import LoginScreen from '../components/Login';
import RegisterScreen from '../components/Register';

export default class Test extends React.Component {
  constructor(props){
    super(props)
    
   
    this.state = {
      cardstate:0
    }
}
  render() {

    return (
          <View style={styles.container}>
              <Card>
          <Button onPress={() => this.setState({ cardstate: 0})}></Button>
          <br/>
          <Button onPress={() => this.setState({ cardstate: 1})}></Button>
          {this.state.cardstate == 0 ? ( <RegisterScreen/> ) : ( <LoginScreen/> )}
          </Card>
            
          </View>        
        
    );
  }
}


const styles = StyleSheet.create({
  container:{
    flex:1,
    flexDirection: 'column',
    justifyContent:'center',
    alignItems: 'stretch',
  },
  containerSignIn:{
    height: 60,
    width:'20%',
    marginTop:'10px',
    alignSelf:'center',

  },
  avatar:{
    height:'120px',
    width:'120px',
    alignSelf:'center',
    marginBottom:'80px'
  
  },
  containerUserName:{
    height: 60,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'#ffffff',
    marginLeft:'10%',
    marginRight:'10%',
  },
  containerPassword:{
    height: 60,
    flexDirection:'row',
    justifyContent:'center',
    backgroundColor:'#ffffff',
    marginLeft:'10%',
    marginRight:'10%',
  },
  containerRegister:{
    height: 60,
    marginLeft:'6%',
    marginRight:'6%',
    marginTop:'20px',
    alignItems: 'center',
  },
  icon:{
    flex:1
  },
  textInput:{
    backgroundColor:'transparent',
    flex:5,
    color:'black',
    paddingLeft:'25%'
  }
})
